import './App.css';
import React from 'react';
import{BrowserRouter as Router,Link, Route} from 'react-router-dom';

function App() {
  return (
    <div className='App'>
      <Router>
        <Link to="/home">Home </Link>
    </Router>
    </div>
  );
}

function Home()
{
  return(
  <div>
    <h1>Home</h1>
    <p>This is Home Page of website</p>
  </div>
  )
}

function About()
{
  return(
  <div>
    <h1>About US</h1>
    <p>This is About US Page of website</p>
  </div>
  )
}

function Blog()
{
  return(
  <div>
    <h1>Blog</h1>
    <p>This is Blog Page of website</p>
  </div>
  )
}

function Contact()
{
  return(
  <div>
    <h1>Contact US</h1>
    <p>This is Contact US Page of website</p>
  </div>
  )
}
export default App;
